import Row from "./Row";

const Modal = (props) =>{
  return(
    <div className="modal">
      <Row text="Font Color" hexCodeClr="#44444"/>
      <button className="btn btn--alt" onClick={props.click}>Cancel</button>
      <button className="btn" onClick={props.click}>Save</button>
    </div>
    
  );
};

export default Modal;
